import "./App.css";
import {Link} from 'react-scroll';

function App() {
  const navItems = [
    {
      id: 1,
      title: "Home"
    },
    {
      id: 2,
      title: "About"
    },
    {
      id: 3,
      title: "Projects"
    },
    {
      id: 4,
      title: "Resume"
    }
  ]
  return (
    <div className="App">
      <header>
        <nav>
        <ul>
          {navItems.map((item) => (
            <li>
              <Link to={item.title} smooth="true" offset={200} duration={500}>{item.title}</Link>
            </li>
          ))}
        </ul>
        </nav>
      </header>

      <main>
        {navItems.map(item => (
          <div className="content">
            <h1 className="content-header" id={item.title}>
              {item.title}
            </h1>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
